import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import Gallery from './Gallery';
import Profile from './Profile';
// import { useNavigate } from 'react-router-dom';
console.log('Menu loaded!');

const Menu = () => {
	// let navigate = useNavigate();
	return (
		// <div className="row ">
		//
		// </div>
		<nav className="navbar fixed-bottom navbar-light bg-light">
			<div className="container-fluid">
				<div className="col btn-group" role="group" aria-label="Basic radio toggle button group">
					<input
						type="radio"
						className="btn-check"
						name="btnradiohome"
						id="btnradio1"
						autoComplete="off"
						defaultChecked
					/>

					<Link to="/gallery" className="btn btn-outline-secondary" htmlFor="btnradiohome">
						<i className="bi bi-house-door-fill" />
						{/* <i class="bi bi-house-door"></i> */}
						<span>Home</span>
					</Link>

					<input type="radio" className="btn-check" name="btnradio" id="btnradiogallery" autoComplete="off" />
					<Link to="/gallery">
						<label
							className="btn btn-outline-secondary"
							htmlFor="btnradiogallery"
							// onClick={() => navigate('/gallery')}
						>
							<i className="bi bi-images" />
							<span>Pics</span>
						</label>
					</Link>

					<input type="radio" className="btn-check" name="btnradio" id="btnradioprofile" autoComplete="off" />

					<Link to="/gallery">
						<label className="btn btn-outline-secondary" htmlFor="btnradioprofile">
							<i className="bi bi-person-fill" />
							<span>You</span>
						</label>
					</Link>
				</div>
			</div>
		</nav>
	);
};

export default Menu;
